export const SET_USER_ID = 'SET_USER_ID'
export const SET_USERNAME = 'SET_USERNAME'

export const setUserId = (userId) => ({
    type: SET_USER_ID,
    userId
})

export const setUsername = (username) => ({
    type: SET_USERNAME,
    username
})
